import React, { Component } from "react";
import Table from "react-bootstrap/Table";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSort } from "@fortawesome/free-solid-svg-icons";

export class selectedComments extends Component {
  render() {
    selectedComments.map(item => {
      return (
        <tbody key={item.id}>
          <tr onClick={() => this.clickedId(item.id)}>
            <td>{item.id}</td>
            <td>{item.name} </td>
            <td>{item.email}</td>
          </tr>
        </tbody>
      );
    });
    return (
      <div className="container">
        <Table striped bordered hover variant="dark">
          <thead>
            <tr>
              <th className="thID" onClick={this.sort}>
                ID{" "}
                <FontAwesomeIcon className="thIcon" icon={faSort} size="1x" />
              </th>
              <th onClick={this.sort}>
                Komentarai{" "}
                <FontAwesomeIcon className="thIcon" icon={faSort} size="1x" />
              </th>
              <th onClick={this.sort}>
                Email{" "}
                <FontAwesomeIcon className="thIcon" icon={faSort} size="1x" />
              </th>
            </tr>
          </thead>
        </Table>
        ;
      </div>
    );
  }
}

export default selectedComments;
